import React from 'react';
import Link from "next/link";
import { getId } from "../modules/notice"

const NoticeList = (props, {getId}) => {


    return (
        <>
            <Link href='/noticeDetail'><li key={props.props.NTC_ID} onClick={getId(props.props.NTC_ID)}>{props.props.NTC_TITLE}</li></Link>
        </>

    )
};


export default NoticeList;
